let productNames = [];
let productPrices = [];
let pgst = [];
let quantities = [];
let cgsts = [];
let sgsts = [];
let tamount = [];
let totalAmount = 0;
let tunitprice = 0;
let tcgst = 0;
let tsgst = 0;
let tcount = 0; 
let productIndex = 1; 


function addProduct() {
    const productName = document.getElementById('PName').value;
    const productPrice = parseFloat(document.getElementById('PPrice').value);
    const qty = parseInt(document.getElementById('qty').value);
    const gst = parseInt(document.getElementById('gst-percent').value);
    const cgst = parseFloat((productPrice * gst / 200).toFixed(2));
    const sgst = parseFloat((productPrice * gst / 200).toFixed(2));
    const tamt = parseFloat(productPrice+ cgst + sgst).toFixed(2);

    if (productName && !isNaN(productPrice) && productPrice > 0) {

        productNames.push(productName);
        productPrices.push(productPrice);
        quantities.push(qty);
        cgsts.push(cgst);
        sgsts.push(sgst);
        tamount.push(tamt);

        const productTable = document.querySelector("#product-table tbody");
        const row = document.createElement('tr');
        row.innerHTML = `
                    <td>${productIndex}</td>
                    <td>${productName}</td>
                    <td>${qty}</td>
                    <td>Rs. ${productPrice.toFixed(2)}</td>
                    <td>Rs. ${cgst}</td>
                    <td>Rs. ${sgst}</td>
                    <td>Rs. ${tamt}</td>
                    <td><span class="delete-button" onclick="deleteProduct(this, ${productPrice}, ${productIndex - 1})">Delete</span></td>
                `;
        productTable.appendChild(row);

        productIndex++;
    }
    document.getElementById('PName').value = "";
    document.getElementById('PPrice').value = "";
    document.getElementById('qty').value = "";
    document.getElementById('gst-percent').value = "";

    updateTotalvalues();
        

}

function updateTotalvalues() {
    totalAmount = 0;
    tunitprice = 0;
    tcgst = 0;
    tsgst = 0;
    tcount = 0; 
    productNames.forEach((name, i) => {
        totalAmount = parseFloat(totalAmount) +  parseFloat(tamount[i]);
        tunitprice = tunitprice + productPrices[i];
        tcount = tcount + quantities[i];
        tcgst = tcgst + cgsts[i];
        tsgst = tsgst + sgsts[i];

    });

}

function deleteProduct(element, productPrice, index) {
  
    const row = element.closest('tr');
    row.remove();

    productNames.splice(index, 1);
    productPrices.splice(index, 1);
    quantities.splice(index, 1);
    cgsts.splice(index, 1);
    sgsts.splice(index, 1);
    tamount.splice(index, 1);

 

    refreshProductTable();
}

function refreshProductTable() {
    const productTableBody = document.querySelector("#product-table tbody");
    productTableBody.innerHTML = ''; 

  
    productIndex = 1;

  
    productNames.forEach((name, i) => {
        const productPrice = productPrices[i];
        const qty = quantities[i];
        const cgst = cgsts[i];
        const sgst = sgsts[i];
        const tamt = tamount[i];
    

        const row = document.createElement('tr');
        row.innerHTML = `
                    <td>${productIndex}</td>
                    <td>${name}</td>
                    <td>${qty}</td>
                    <td>Rs. ${productPrice.toFixed(2)}</td>
                    <td>Rs. ${cgst}</td>
                    <td>Rs. ${sgst}</td>
                    <td>Rs. ${tamt}</td>
                    <td><span class="delete-button" onclick="deleteProduct(this, ${productPrice}, ${i})">Delete</span></td>
                `;
        productTableBody.appendChild(row);
        productIndex++; 
    });
    updateTotalvalues();
}
